import React from 'react';
import classes from './Description.module.css';
import jsImage from '../../assets/javascript_round.png';
import nodeImage from '../../assets/node.png';
import reactImage from '../../assets/react.png';
import reduxImage from '../../assets/redux.png';

const description = () => {
    return (
        <div className={classes.Description}>
            <h1>FRONT END FOCUSED WITH FULL STACK EXPERIENCE</h1>
            <div className={classes.skillsContainer}>
                <div className={classes.skillsDesc}>
                    <p>Skills:</p>
                    <ul>
                        <li>JavaScript</li>
                        <li>React</li>
                        <li>Redux</li>
                        <li>Express JS</li>
                        <li>Node JS</li>
                        <li>MongoDB</li>
                    </ul>
                </div>
                <div className={classes.imagesContainer}>
                    <img src={jsImage} height={100} width={100}/>
                    <img src={nodeImage} height={125} width={150}/>
                    <img src={reactImage} height={100} width={120}/>
                    <img src={reduxImage} height={100} width={100}/>
                </div>
            </div>
        </div>
    )
}

export default description;
